import "./Register.css";
function Register() {
  return (
    <div>
      <div className="form-containter">
        <form action="" className="form">
          <input type="text" />
          <input type="text" />
          <input type="password" />
          <button></button>
        </form>
      </div>
    </div>
  );
}

export default Register;
